import React, { Component } from "react";

export default () => {
  return (
    <div
      style={{
        padding: "20px",
        color: "white",
        backgroundColor: "teal",
        position: "relative",
        bottom: "0",
        width: "100%"
      }}
    >
      <h3>Creator: Hrishikesh Bawane</h3>
      <h4>Email: hrishibawane.hvb@gmail.com</h4>
      <h4>Github: <a style={{color:"white"}} target="_blank" href="https://github.com/hrishibawane">github.com/hrishibawane</a></h4>
      <h4>Linkedin: <a style={{color:"white"}} target="_blank" href="https://www.linkedin.com/in/hrishikesh-bawane-130797">linkedin.com/in/hrishikesh-bawane-130797</a></h4>
    </div>
  );
};
